// components/models/ModelList.jsx
import React, { useState, useMemo, useEffect } from "react";
import DataTable from "react-data-table-component";
import {
  useGetModelsQuery,
  useDeleteModelMutation,
} from "../../redux/api/modelApi";
import toast from "react-hot-toast";
import AddModelForm from "./AddModelForm";
import ModelViewModal from "./ModelViewModal";

const ModelList = () => {
  const [searchTerm, setSearchTerm] = useState("");
  const [showForm, setShowForm] = useState(false);
  const [editModel, setEditModel] = useState(null);
  const [viewModel, setViewModel] = useState(null);

  const { data, isLoading, refetch } = useGetModelsQuery();
  const [deleteModel] = useDeleteModelMutation();

  const models = data?.models || [];

  const handleDelete = async (id) => {
    if (!window.confirm("Are you sure?")) return;
    try {
      await deleteModel(id).unwrap();
      toast.success("Deleted successfully");
      refetch();
    } catch (err) {
      toast.error("Delete failed");
    }
  };

  const filtered = useMemo(() => {
    if (!searchTerm.trim()) return models;
    const s = searchTerm.toLowerCase();
    return models.filter((m) => {
      const target = `${m.name} ${m.email || ""} ${m.phone || ""} ${
        m.city || ""
      } ${m.skills?.join(",") || ""}`.toLowerCase();
      return target.includes(s);
    });
  }, [searchTerm, models]);

  const columns = [
    { name: "Name", selector: (r) => r.name, sortable: true, center: true },
    { name: "Gender", selector: (r) => r.gender, center: true },
    { name: "City", selector: (r) => r.city || "-", center: true },
    {
      name: "Experience",
      selector: (r) => r.experienceLevel || "-",
      center: true,
    },
    {
      name: "Profile",
      cell: (r) =>
        r.profileImage?.url ? (
          <img
            src={r.profileImage.url}
            alt="p"
            style={{
              width: 48,
              height: 48,
              objectFit: "cover",
              borderRadius: 6,
            }}
          />
        ) : (
          "-"
        ),
      center: true,
    },
    {
      name: "Status",
      cell: (r) => (
        <span
          className={`badge bg-${
            r.status === "approved"
              ? "success"
              : r.status === "pending"
              ? "warning"
              : "secondary"
          }`}
        >
          {r.status}
        </span>
      ),
      center: true,
    },
    {
      name: "Actions",
      cell: (row) => (
        <div className="dropdown position-static">
          <button
            className="btn btn-sm btn-secondary dropdown-toggle"
            data-bs-toggle="dropdown"
          >
            Actions
          </button>
          <ul className="dropdown-menu position-fixed">
            <li>
              <button
                className="dropdown-item"
                onClick={() => setViewModel(row)}
              >
                View
              </button>
            </li>
            <li>
              <button
                className="dropdown-item"
                onClick={() => {
                  setEditModel(row);
                  setShowForm(true);
                }}
              >
                Edit
              </button>
            </li>
            <li>
              <button
                className="dropdown-item"
                onClick={() => handleDelete(row._id)}
              >
                Delete
              </button>
            </li>
          </ul>
        </div>
      ),
      ignoreRowClick: true,
      allowOverflow: true,
      button: true,
      center: true,
    },
  ];

  return (
    <div className="container mt-4">
      <div className="d-flex justify-content-between align-items-center mb-3">
        <h2>Models</h2>
        <button
          className="btn btn-primary"
          onClick={() => {
            setEditModel(null);
            setShowForm(!showForm);
          }}
        >
          {showForm ? "Close Form" : "Add Model"}
        </button>
      </div>

      {showForm && (
        <AddModelForm
          model={editModel}
          onSaved={() => {
            setShowForm(false);
            refetch();
          }}
        />
      )}

      <div className="mb-3">
        <input
          type="text"
          className="form-control"
          placeholder="Search models..."
          value={searchTerm}
          onChange={(e) => setSearchTerm(e.target.value)}
        />
      </div>

      <DataTable
        columns={columns}
        data={filtered}
        progressPending={isLoading}
        pagination
        highlightOnHover
        responsive
        striped
        noDataComponent="No models found"
      />

      {viewModel && (
        <ModelViewModal model={viewModel} onClose={() => setViewModel(null)} />
      )}
    </div>
  );
};

export default ModelList;
